  false,\n\t\"url\": null,\n\t\"notes\": \"The Global Precipitation Climatology Project
  (GPCP) comprises a total of 27 products. The Version 1.2 Daily product covers the
  period October 1998 to the present, with a delay of two to three months for data
  reception and processing. Version 1.2 supersedes all previous versions of the GPCP
  daily product. (Previous versions are not available from the NOAA/NCEI archive).
  All the GPCP products are produced by optimally merging precipitation estimates
  computed from microwave, infrared, sounder data observed by the international constellation
  of precipitation-related satellites, and precipitation gauge analyses, taking advantage
  of the strengths of each data type. Files are provided monthly, and the newest daily
  data are appended to a monthly data file as they are available. Data are available
  on a 1 degree grid. Code and documentation are also available.\",\n\t\"owner_org\":
